import React from 'react';
import Header from '../../components/Header/Header';
import HeroSection from '../../components/HeroSection/HeroSection';
import ExploreSection from '../../components/Explore/ExploreSection';
import TrendingDesigns from '../../components/TrendingDesigns/TrendingDesigns';
import BookConsultation from '../../components/BookConsultation/BookConsultation'; // Import the BookConsultation component
import Footer from '../../components/Footer/Footer';
import SatisfiedUser from '../../components/SatisfiedUser/SatisfiedUser';
import './HomePage.css';

const HomePage = () => {
  return (
    <>
      <Header />
      <HeroSection />
      <ExploreSection />
      <TrendingDesigns />
      <BookConsultation /> {/* Add the BookConsultation section */}
      <SatisfiedUser /> {/* Add the SatisfiedUser section */}
      <Footer />
    </>
  );
};

export default HomePage;
